description:
Recently sold: $235,000. Enjoy this 4 bedroom, 2 bathroom home with many upgrades throughout.  This wonderful home has a  newly renovated kitchen with new cabinets, appliances and wood floors.  The Living Room with vaulted ceiling is open to the dining room that walks out to a nice deck.  The upper level bathroom has been updated with new tile and vanity, and a new roof was installed in May of 2007.  Need more space, and the lower level  offers a family room, and a large laundry room with cabinets for storage.  The nicely landscaped yard is beautiful with flower beds, is easily maintained with an irrigation system, has a 10x10 shed, and is fenced in for your privacy.       Call this &quot;Home for the Holidays!&quot;




Neighborhood Description



Wonderful area close to shopping, restaurants, parks and golf courses.
